import HeaderLog from '../../images/logo.svg'

function Header() {

  return (
    <div className="header">
      <image className="logo logo_place_header" src={HeaderLog} alt="Круг"/>
      <div className="navigation">
        <div className="navigation__profail navigation__profail_private"></div>
        <input className="navigation__register"></input>
        <input className="navigation__aut"></input>
      </div>
    </div>
  )
}

export default Header;
